import React, {useState} from 'react';
import {Link} from 'react-router-dom';
import {FaBars, FaGithub, FaLinkedin} from 'react-icons/fa';
import {HiX} from 'react-icons/hi';
import './styles.css';

const data = [
    {
        label : 'HOME',
        to : '/'
    },

    {
        label : 'ABOUT',
        to : '/about'
    },

    {
        label : 'EXPERIENCE',
        to : '/experience'
    },

    {
        label : 'PROJECTS',
        to : '/projects'
    },

    {
        label : 'CONTACT',
        to : '/contact'
    },
]

const Navbar = () => {


    const [toggleIcon, setToggleIcon] = useState(false);

    // func that changes value of toggleIcon (true or false)
    const handleToggleIcon = () => {
        setToggleIcon(!toggleIcon); //sets the new state to the opposite of its curr val
    };

    return (
        <div>
            <nav className="navbar">
                <div className="navbar-container">
                    <Link to = {'/'} className="navbar-container-logo">
                        KY
                    </Link>
                </div>
                <ul className="navbar-container-menu">
                    {
                        data.map((item, key)=> (
                            <li key={key} className="navbar-container-menu-item">
                                <Link to={item.to} className="navbar-container-menu-item-link">
                                    {item.label}
                                </Link>
                            </li>
                        ))
                    }
                </ul>

                <div className="navbar-socials">
                    {/* GitHub Icon */}
                    <a href="https://github.com/your-username" target="_blank" rel="noopener noreferrer" className="social-icon">
                        <FaGithub size="24" />
                    </a>
                    {/* LinkedIn Icon */}
                    <a
                    href="https://linkedin.com/in/your-username"
                    target="_blank"
                    rel="noopener noreferrer" className="social-icon">
                    <FaLinkedin size="24" />
                    </a>
                </div>

                <div className="nav-icon" onClick={handleToggleIcon}>
                    {
                        // check if toggleIcon is true. If it is,render HiX, else render FaBars
                        toggleIcon ? <HiX size="30"/> : <FaBars size="30"/>
                    }
                </div>
            </nav>
        </div>
    )
}

export default Navbar;
